const FFfooter = () => {
  return (
    <>
      <footer className="py-2 pt-5">
        <div className="container py-3">
        <div className="row footer-content">
          <div className="col-6 col-md-2 mb-3">
            <h5 className='mb-3 '> <span className='heading1'>Services</span></h5>
            <ul className="nav flex-column footer-nav1">
              <li className="nav-item mb-2"><a href="/" className="nav-link p-0 ">Home</a></li>
              <li className="nav-item mb-2"><a href="/" className="nav-link p-0 ">Features</a></li>
              <li className="nav-item mb-2"><a href="/" className="nav-link p-0 ">Pricing</a></li>
              <li className="nav-item mb-2"><a href="/" className="nav-link p-0 ">FAQs</a></li>
              <li className="nav-item mb-2"><a href="/" className="nav-link p-0 ">About</a></li>
            </ul>
          </div>
    
          <div className="col-6 col-md-2 mb-3">
            <h5 className='mb-3'><span className="heading2">Opening hours</span></h5>
            <ul className="nav flex-column">
              <li className="nav-item mb-2"><a href="/" className="nav-link p-0 ">monday(24X)</a></li>
              <li className="nav-item mb-2"><a href="/" className="nav-link p-0 ">Features</a></li>
              <li className="nav-item mb-2"><a href="/" className="nav-link p-0 ">Pricing</a></li>
              <li className="nav-item mb-2"><a href="/" className="nav-link p-0 ">FAQs</a></li>
            </ul>
          </div>
    
          <div className="col-6 col-md-2 mb-3">
            <h5 className='mb-3'><span className="heading2">Contact info</span></h5>
            <ul className="nav flex-column">
              <li className="nav-item mb-2"><a href="/" className="nav-link p-0 "><i className="fa-brands fa-map fa-sm"></i> 780 S Arroyo Parkway Pasadena, CA 91105 California</a></li>
              <li className="nav-item mb-2"><a href="/" className="nav-link p-0 "><i className="fa-brands fa-map fa-sm"></i> +1 626-263-0683</a></li>
              <li className="nav-item mb-2"><a href="/" className="nav-link p-0 "><i className="fa-brands fa-map fa-sm"></i> fitnessfreak@gmail.com</a></li>
            </ul>
          </div>
    
          <div className="col-md-5 offset-md-1 mb-3">
            <form>
              <h3>Give Feedback to our Mail</h3>
              <p>Monthly digest of what's new and exciting from us.</p>
